JSON is easy for humans to read and write & for machines to parse and generate. It is supported by many programming languages and is especially useful for JavaScript-based apps, websites and browser extensions. How it looks JSON represents numbers, booleans, strings, null, arrays, and objects made up of these values (or of other arrays and objects). The curly brackets holds objects. The square brackets holds arrays. Property names are double-quoted. Properties are separated by commas. Here is an example of a JSON, You are free to play around it : { "first_property_name": "First Property Value of type String", "property_name_is_aka_key": 2022, "boolean_property_true_or_false": true, "null_property": null, "array_type_property": ["a", "b", "c"], "object_type_property": { "number_type_property": 2022 }
} ServiceNow Scripts - Background I would like to quote Ben Sweetser as is when it comes to Scripts - Background : Scripts - Background was this magical place in the platform where you could run any server-side script. It became my testing ground for any server-side method I wanted to learn about or new script I wanted to test because I did not need to configure When to run logic around it like a Business Rule. Running a script in Scripts - Background was as easy as putting a script in the field and clicking the Run script button. You can read the article by Ben Sweetser here if you need to learn more about it. To open Scripts - Background, use the Application Navigator to open System Definition > Scripts - Background. It is going to be our playground and a friend in our journey. Scripts Background typeof & gs.info() The typeof operator returns a string indicating the type of the value provided, Whereas, gs.info method writes an info message to the system log. Combination of both of them are extremely useful when it comes to debugging but let us use them here for another purpose. You can read more about them typeof here and info as well as other useful GlideSystem methods here . Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(jsonObj)
gs.info(typeof jsonObj) typeof 1 Now click the Run Script button to execute the script. You should see the following output : typeof 2 The second line of the output indicates that jsonObj variable stores an object. Though, notice that the first line of the output does not display the content of jsonObj variable. JSON serialization & deserialization JSON is a syntax for serializing objects, arrays, numbers, strings, booleans, and null. Serialization means to convert an object into that string, and deserialization is its inverse operation. JSON.stringify(value[, replacer[, space]]) The JSON.stringify() method converts a JavaScript object or value to a JSON string, optionally replacing values if a replacer function is specified or optionally including only the specified properties if a replacer array is specified. Following are three variations of the method and we will go through each of them one by one : JSON.stringify(value)
JSON.stringify(value, replacer)
JSON.stringify(value, replacer, space) JSON.stringify(value) Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(JSON.stringify(jsonObj))
var jsonStr = JSON.stringify(jsonObj)
gs.info(jsonStr)
gs.info(typeof jsonStr) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 The first and second line of output displays the stringified version of JSON object and the third line indicates that it is of type string. JSON.stringify(value, replacer) & JSON.stringify(value, replacer, space) Before we talk about the second parameter, replacer, I would like you to be familiar with the third parameter i.e. space. It can be a String or Number object that's used to insert white space (including indentation, line break characters, etc.) into the output JSON string for readability purposes. If this parameter is not provided (or is null), no white space is used. If this is a Number, it indicates the number of space characters to use as white space for indenting purposes; this number is capped at 10 (if it is greater, the value is just 10). Values less than 1 indicate that no space should be used. If this is a String, the string (or the first 10 characters of the string, if it's longer than that) is used as white space. If it is a number, successive levels in the stringification will each be indented by this many space characters (up to 10). If it is a string, successive levels will be indented by this string (or the first ten characters of it). Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(JSON.stringify(jsonObj, null, 4))
gs.info(JSON.stringify(jsonObj, null, "\t")) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 Both the outputs are now displayed in more readable format. Finally, Let us talk about the second parameter, replacer. It can be a function that alters the behavior of the stringification process, or an array of String and Number that serve as an allowlist for selecting/filtering the properties of the value object to be included in the JSON string. If this value is null or not provided, all properties of the object are included in the resulting JSON string. The replacer parameter can be either a function or an array. replacer, as an array If replacer is an array, the array's values indicate the names of the properties in the object that should be included in the resulting JSON string. Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(JSON.stringify(jsonObj, ["Course", "Skills"], 4))
gs.info(JSON.stringify(jsonObj, ["Course", "Skills"])) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 As you might have noticed already, only course and skills are the properties that are added to the new JSON string. replacer, as a function : As a function, it takes two parameters: the key and the value being stringified. The object in which the key was found is provided as the replacer's this parameter. Initially, the replacer function is called with an empty string as key representing the object being stringified. It is then called for each property on the object or array being stringified. It should return the value that should be added to the JSON string, as follows: If you return a Number, String, Boolean, or null, the stringified version of that value is used as the property's value. If you return a Function, Symbol, or undefined, the property is not included in the output. If you return any other object, the object is recursively stringified, calling the replacer function on each property. Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(JSON.stringify(jsonObj, replacer))
gs.info(JSON.stringify(jsonObj, replacer, 4)) function replacer(key, value) { if (typeof value == "string") { return "test_" + value } return value
} json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 We have modified every string value using our replacer function and appended by "test_". We have seen examples of JSON.stringify() and how it works. It converts a value to JSON notation representing it: Boolean, Number, and String objects are converted to the corresponding primitive values during stringification. undefined, Functions, and Symbols are not valid JSON values. If any such values are encountered during conversion they are either omitted (when found in an object) or changed to null (when found in an array). JSON.stringify() can return undefined when passing in "pure" values like JSON. The numbers Infinity and NaN, as well as the value null, are all considered null. If the value has a toJSON() method, it's responsible to define what data will be serialized. JSON.parse(text[, reviver]) The JSON.parse() method parses a JSON string, constructing the JavaScript value or object described by the string. It parses the string text as JSON, optionally transform the produced value and its properties, and return the value. Following are three variations of the method and we will go through each of them one by one : JSON.parse(text)
JSON.parse(text, reviver) Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "test_IntegrateNow", Skills: ["test_Integration", "test_JSON", "test_ServiceNow"], name: { first_name: "test_Vishal", last_name: "test_Ingle", },
} var jsonStr = JSON.stringify(jsonObj)
gs.info(jsonStr)
gs.info(typeof jsonStr) gs.info(JSON.parse(jsonStr))
var jsonObjFromString = JSON.parse(jsonStr)
gs.info(jsonObjFromString)
gs.info(typeof jsonObjFromString) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 After executing the code we are certain that jsonStr is a string and line two of output conveys that. JSON.parse() method converts this json string into an JSON object, last line of the output shows that jsonObjFromString is now an object. Using the reviver parameter An optional reviver function can be provided to perform a transformation on the resulting object before it is returned or in other words, If a reviver is specified, the value computed by parsing is transformed before being returned. It allows for interpreting what the replacer has used to stand in for other datatypes. The computed value and all its properties (beginning with the most nested properties and proceeding to the original value itself) are individually run through the reviver. Then it is called, with the object containing the property being processed as this, and with the property name as a string, and the property value as arguments. If the reviver function returns undefined (or returns no value, for example, if execution falls off the end of the function), the property is deleted from the object. Otherwise, the property is redefined to be the return value. If the reviver only transforms some values and not others, be certain to return all untransformed values as-is, otherwise, they will be deleted from the resulting object. Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "test_IntegrateNow", Skills: ["test_Integration", "test_JSON", "test_ServiceNow"], name: { first_name: "test_Vishal", last_name: "test_Ingle", },
} var jsonStr = JSON.stringify(jsonObj) var jsonObjFromString = JSON.parse(jsonStr, reviver) gs.info(JSON.stringify(jsonObjFromString, null, 4)) function reviver(key, value) { if (typeof value === "string") { return value.toString().slice(5) } else { return value }
} json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 We have modified every string value using our reviver function and removed "test_" from it, Output shows the stringified version of this modified object. We have seen examples of JSON.parse() and how it works. If you are interested in learning more about JSON and its methods, Mozilla developer documentation is a best place to start with, It has everything you need right here . Hey, we are not done yet, There are still few more things we need to know. Working with JSON properties We have kind of already touched these concepts, but let us be more specific to them because they are far more important and needful to us. we could then access the data inside an object using the dot or bracket notation. An object property can itself be an object, to access these items you just need to chain the extra step onto the end with another dot or bracket. We can also set (update) the value of object members by declaring the member the same way. Let us look at the example to understand what I mean. Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(JSON.stringify(jsonObj, null, 4))
gs.info(jsonObj.Course)
gs.info(jsonObj.name.first_name)
gs.info(jsonObj["Course"])
gs.info(jsonObj["name"]["first_name"]) jsonObj.chapter = "Chapter 2"
jsonObj["title"] = "What you need to know abour JSON and Objects" gs.info(JSON.stringify(jsonObj, null, 4)) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 First we did display the stringified version of initial JSON Object. Next we did log the properties course and first_name from object using dot notation and brackets notation both. Though we have received the same response, it is best to use dot notation for performance reasons. but brackets notation has it's own use cases e.g. if you want to access the array type property's elements. After that we did add two more properties to our object using both dot and brackets notation and then logged the stringified version of object. We can see that our object now contains two new properties chapter & title. Object.keys() & hasOwnProperty() The Object.keys() method returns an array of a given object's own enumerable property names. And the hasOwnProperty() method returns a boolean indicating whether the object has the specified property as its own property. Copy the following code and paste it into the Scripts - Background. var jsonObj = { Course: "IntegrateNow", Skills: ["Integration", "JSON", "ServiceNow"], name: { first_name: "Vishal", last_name: "Ingle", },
} gs.info(Object.keys(jsonObj))
gs.info(jsonObj.hasOwnProperty("Skills"))
gs.info(jsonObj.hasOwnProperty("more_skills")) json 1 Now click the Run Script button to execute the script. You should see the following output : json 2 The first line of output lists all the property names of our objects. Line two of our output indicates that we have the property named Skills in our object. Line three does indicate the same by returning false. Finally, We did reach to the end of this chapter. This is the minimum you need to know about JSON and Objects to follow along with me. If you want to dig deep, Mozilla is again the best platform right here to learn about objects.

