The very first thing that we should fix is the request body or data that we will pass to the server. It is static meaning it will always create an incident with same information. We want it to be dynamic and it should fetch the information from the incident for which the Business Rule is triggered. Notice the following line from the above script : request.setRequestBody( '{"short_description":"Test SD","description":"Test Desc","assignment_group":"0a52d3dcd7011200f2d224837e6103f2","impact":"2","urgency":"1","state":"3","hold_reason":"4","category":"inquiry","contact_type":"email"}'
) setRequestBody() method accepts one string parameter as the body content to send to the web service provider when using PUT or POST HTTP methods. In above example, we are passing a static json string as a parameter value. Which means we can rewrite above line of code as below: var reqBody = { short_description: "Test SD", description: "Test Desc", assignment_group: "0a52d3dcd7011200f2d224837e6103f2", impact: "2", urgency: "1", state: "3", hold_reason: "4", category: "inquiry", contact_type: "email",
}
request.setRequestBody(JSON.stringify(reqBody)) What we did here is storing the content of our request body as an json object and then convert it to string right before passing it to the server. If you are not aware of how this works, you have probably skipped Chapter 2 , where we did talk a lot about json and I encourage you to go back and get familier with it. Now let us use the current argument of Business rule to fetch the values from current incident dynamically: var reqBody = { short_description: current.getDisplayValue("short_description"), impact: current.getValue("impact"), urgency: current.getValue("urgency"), state: current.getValue("state"),
}
request.setRequestBody(JSON.stringify(reqBody)) Here, I have removed the other properties from the object on purpose. We will add them back to the object after we perform some manipulation on the information. Why? Remember the tweaks that we need to consider; it is necessary to write a clean code to not make it unnecessarily un-readable. Let us tackle each of this tweaks: Tweak 1 : Our Vendor (Company A) instance has an additional On hold reason choice "Awaiting Company A Validation" (for some internal validation). Whereas our Customer (Company B) instance has all Out of the box (OOTB) choices. So, we need to map our custom choice "Awaiting Company A Validation" from the Vendor instance to the "Awaiting Vendor" on the Customer i.e. Company B instance. drawio2 To implement this, We could rewrite our line of code as below : var reqBody = { short_description: current.getDisplayValue("short_description"), impact: current.getValue("impact"), urgency: current.getValue("urgency"), state: current.getValue("state"),
}
if (current.getValue("state") == "3") { //if State is On Hold var onHoldReason = current.getValue("hold_reason") if (onHoldReason == "6") { //if Awaiting Company A Validation onHoldReason = "4" //set to Awaiting Vendor } reqBody["hold_reason"] = onHoldReason //add the property to object reqBody
}
request.setRequestBody(JSON.stringify(reqBody)) Tweak 2 : We have an additional Contact type "API" on Customer instance and no matter through which channel the incident is created on Vendor instance, the target incident on Customer instance should have the Contact type set as "API". drawio3 We also have the requirement to always map the incident to the "Inquiry / Help" category on Customer instance: drawio4 Since, we always need the static values for contact type and category values, we can leverage the system properties to modify our code as below : var reqBody = { short_description: current.getDisplayValue("short_description"), impact: current.getValue("impact"), urgency: current.getValue("urgency"), state: current.getValue("state"),
}
if (current.getValue("state") == "3") { //if State is On Hold var onHoldReason = current.getValue("hold_reason") if (onHoldReason == "6") { //if Awaiting Company A Validation onHoldReason = "4" //set to Awaiting Vendor } reqBody["hold_reason"] = onHoldReason //add the property to object reqBody
}
reqBody["contact_type"] = gs.getProperty("integratenow.customer.contact_type") //set Contact Type as API
reqBody["category"] = gs.getProperty("integratenow.customer.category") //set Category as Inquiry / Help
reqBody["assignment_group"] = gs.getProperty( "integratenow.customer.assignment_group"
) //set target/customer Assignment group (FirstIntegrationGroup)
request.setRequestBody(JSON.stringify(reqBody)) Here, I've also set the target assignment group which is predefined by business. But none of these system properties are defined yet, so we need to create them : In the Navigation filter, type sys_properties.list and click enter ch5_1 Click New ch5_2 Name the property as integratenow.customer.contact_type ch5_3 Set the desired string value for field Value as API & click submit. ch5_4 Create two more properties as below: Name : integratenow.customer.category , Value : inquiry Name : integratenow.customer.assignment_group , Value : a12fc27d87da491028720d47dabb35d9 ch5_5 ch5_6 ch5_7 A point to remember here (and going forward), all the custom values for the records that we did create, including group sys_id might be different for you. So be cautious! Tweak 3 : And the last tweak that we need to tackle is that the Service, Service Offering and the Description needs to be mapped with to Description field: drawio5 Let us rewrite our line of code to accomodate this requirement: var reqBody = { short_description: current.getDisplayValue("short_description"), impact: current.getValue("impact"), urgency: current.getValue("urgency"), state: current.getValue("state"),
}
if (current.getValue("state") == "3") { //if State is On Hold var onHoldReason = current.getValue("hold_reason") if (onHoldReason == "6") { //if Awaiting Company A Validation onHoldReason = "4" //set to Awaiting Vendor } reqBody["hold_reason"] = onHoldReason //add the property to object reqBody
}
reqBody["contact_type"] = gs.getProperty("integratenow.customer.contact_type") //set Contact Type as API
reqBody["category"] = gs.getProperty("integratenow.customer.category") //set Category as Inquiry / Help
reqBody["assignment_group"] = gs.getProperty( "integratenow.customer.assignment_group"
) //set target/customer Assignment group (FirstIntegrationGroup)
var newDescription = "Service: " + current.getDisplayValue("business_service") + "\n" + "Service Offering: " + current.getDisplayValue("service_offering") + "\n" + "Description: " + current.getDisplayValue("description")
reqBody["description"] = newDescription.toString()
request.setRequestBody(JSON.stringify(reqBody)) Here, we did assume that All the fields will have some value, but you are free to modify and make it more fail safe.

